import React from 'react'
import NewCard from '../../shared/newCard'
import newarrivalsData from '../../assets/data/newarrivals'
import {Col} from 'reactstrap'

const NewArrivalsList = () => {
  return (
  <>
  {
    newarrivalsData?.map(newarrival=>(
      <Col lg='3' className='mb-4' key={newarrival.id}>
        <NewCard newarrival={newarrival}/>
      </Col>

    ))
  }
  </>)
}

export default NewArrivalsList
